import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => {
  return ( 
  	<div className="navabar">
        <div className="leftSide">
            <h1>LOGO HERE</h1>
        </div>
        <div className="rightSide">
            <Link to="/">Home</Link>
            <Link to="/about">About</Link>
        </div>
    </div>
  );
};
 
 export default Navbar;
